import logo from './logo.svg';
import './App.css';
import bg from './img/bg.png';
import { Button, Navbar, Container, Nav } from 'react-bootstrap';
import { useState} from "react";
import data from './data.js';


function App() {


  let [shoes] = useState(data) 

  return(
    <div>
       <Navbar bg="light" variant="dar">
        <Container>
          <Navbar.Brand href="#menu">Menu</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#brunch">Brunch</Nav.Link>
            <Nav.Link href="#search">Search</Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      <div className="main-bg" style={{backgroundImage: 'url('+ bg + ')'}}></div>
      <div className="keyword"></div>
      <div className = 'container'>
        <div className = "row">
          <Card shoes={shoes[0]}></Card>
          <Card shoes={shoes[1]}></Card>
          <Card shoes={shoes[2]}></Card>  
        </div>
      </div>

    </div>




  );
}

function Card(props) {
  return (
    <div className="card">   
    <div>{props.shoes.image}</div>
    <div>{props.shoes.price}</div>
    <div>{props.shoes.content}</div>
  </div>
  )
}
export default App;
